import { Mail, MapPin, Phone } from 'lucide-react';
import React from 'react'

const Contact = () => {

    const data = [
        { title: "Téléphone", value: "+33 758 065 128",icon:<Phone/> },
        { title: "Courrier éléctronique", value: "chauffeursvtc.paris@gmail.com",icon:<Mail/> },
        { title: "Emplacement", value: "Paris, france",icon:<MapPin/>  },
      ];


  return (
    <div className="w-100">
        <div className='fs-6 fw-bold'>Liens utiles</div>
        <div className="d-flex flex-column justify-content-around my-3">
            {data.map((item, index) => (
                <div>
                    <div>{item.title}</div>
                    <div className="text-white my-2" role="button" key={index} ><span className='background-main'>{item.icon}</span> {item.value}</div>
                </div>
            ))}
        </div>
    </div>
  )
}

export default Contact
